import blackLogo from "../images/blackLogo.png";

const Nav = () => {
    return (
        <div class="nav">
            <div className="nav-container">
                <a href="#" class="logo">
                    <img src="blackLogo.png" alt="LearnHyve" />
                </a>
                <div className="nav-links">
                    <a href="">Home</a>
                    <a href="">Features</a>
                    <a href="">Workshops</a>
                    <a href="">Blogs</a>
                    <a href="">About</a>
                    <button className="contact-btn">Contact Us</button>
                </div>
                <div class="menu-toggle">â˜°</div>
            </div>
        </div>
    )
}

export default Nav;
